PROCEDURE Proc_Employee_GetEmployeeByID (IN v_EmployeeID char(36))
COMMENT 'Lấy ra thông tin chi tiết của một nhân viên'
BEGIN
  -- =============================================
  -- Author:       ANHDV
  -- Created date:  15/09/2022
  -- Description:   Lấy ra thông tin chi tiết của một nhân viên
  -- Modified by:   
  -- Code chạy thử: CALL Proc_Employee_GetEmployeeByID('Dán id nhân viên vào đây')
  -- =============================================
  SELECT
    e.EmployeeID,
    e.EmployeeCode,
    e.EmployeeName,
    e.DateOfBirth,
    e.Gender,
    e.EmployeeAddress,
    d.DepartmentID,
    d.DepartmentCode,
    d.DepartmentName,
    e.JobTitle,
    e.IdentityNumber,
    e.IdentityDate,
    e.IdentityPlace,
    e.PhoneNumber,
    e.TelephoneNumber,
    e.Email,
    e.BankAccountNumber,
    e.BankName,
    e.IsCustomer,
    e.IsSupplier,
    e.BankBranch,
    e.CreatedDate,
    e.CreatedBy,
    e.ModifiedDate,
    e.ModifiedBy
  FROM employee e
    LEFT JOIN department d
      ON e.DepartmentID = d.DepartmentID
  WHERE e.EmployeeID = v_EmployeeID;
END
$$

