--
-- Create procedure `Proc_Employee_GetPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetPaging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(1000))
COMMENT 'Lấy danh sách nhân viên và tổng số nhân viên có phân trang'
BEGIN
  -- =============================================
  -- Author:       ANHDV
  -- Created date:  15/09/2022
  -- Description:   Lấy danh sách nhân viên và tổng số nhân viên có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL Proc_Employee_GetPaging(0,10,'','')
  -- =============================================

  -- Kiểm tra nếu tham số đầu vào $Where bị NULL --> gán giá trị cho v_Where = ''
  -- SELECT * FROM employee WHERE 1=1;
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  -- Kiểm tra nếu tham số đầu vào v_Sort bị NULL --> gán giá trị cho v_Sort = ''
  -- SELECT * FROM employee WHERE 1=1 ORDER BY ModifiedDate DESC;
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  IF v_Limit = -1 THEN  -- Lấy tất cả dữ liệu nếu v_Limit = -1
    SET @filterQuery = CONCAT('SELECT * FROM employee WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM employee WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);
  END IF;

  -- @filterQuery là 1 biến có kiểu dữ liệu là string
  -- filterX là 1 statement
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  -- Lấy ra tổng số bản ghi thỏa mãn điều kiện lọc
  SET @filterQuery = CONCAT('SELECT count(EmployeeID) AS TotalCount FROM employee WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

