CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_FindAll (IN v_table varchar(64))
COMMENT 'Lấy ra tất cả bản ghi của một bảng bất kì'
BEGIN
  -- =============================================
  -- Author:       ANHDV
  -- Created date:  15/09/2022
  -- Description:  Lấy ra tất cả bản ghi của một bảng bất kì
  -- Modified by:   
  -- Code chạy thử: CALL misa.web08.tcdn.dva.Proc_Employee_FindAll('Employee');
  -- =============================================
  SET @sql = CONCAT('SELECT * FROM ', v_table);
  PREPARE stmt FROM @sql;
  EXECUTE stmt;
  DEALLOCATE PREPARE stmt;

  -- Lấy ra tổng số bản ghi thỏa mãn điều kiện lọc
  SET @countQuery = CONCAT('SELECT count(*) AS TotalCount FROM ', v_table);
  PREPARE filterQuery FROM @countQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

